import React, { useState } from "react";
import MoleculeViewer from "./MoleculeViewer";
import ToxicFragmentHighlight from "./ToxicFragmentHighlight";

export default function App() {
  const [smiles, setSmiles] = useState("");
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);

  const endpointMeaning = {
    "NR-AR": "Androgen",
    "NR-AR-LBD": "AR-Binding",
    "NR-AhR": "Pollutants",
    "NR-Aromatase": "Hormones",
    "NR-ER": "Estrogen",
    "NR-ER-LBD": "ER-Binding",
    "NR-PPAR-gamma": "Metabolism",
    "SR-ARE": "Oxidative",
    "SR-ATAD5": "DNA-Repair",
    "SR-HSE": "Heat-Shock",
    "SR-MMP": "Mitochondria",
    "SR-p53": "DNA-Damage",
  };

  const thStyle = {
    textAlign: "left",
    padding: "10px",
    background: "#f2f2f2",
    borderBottom: "2px solid #ddd",
  };

  const tdStyle = {
    padding: "10px",
    borderBottom: "1px solid #eee",
  };

  async function handlePredict() {
    if (!smiles.trim()) return alert("Please enter a SMILES string!");
    setLoading(true);
    setResult(null);

    try {
      const res = await fetch("http://127.0.0.1:5000/predict", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ smiles }),
      });

      const data = await res.json();
      setResult(data);
    } catch (err) {
      setResult({ error: "Backend not reachable" });
    } finally {
      setLoading(false);
    }
  }

  return (
    <div
      style={{
        fontFamily: "Inter, sans-serif",
        background: "#f5f7fb",
        minHeight: "100vh",
        padding: "40px 0",
        display: "flex",
        justifyContent: "center",
      }}
    >
      <div
        style={{
          width: "650px",
          background: "white",
          padding: "30px",
          borderRadius: "16px",
          boxShadow: "0 4px 18px rgba(0,0,0,0.1)",
        }}
      >
        <h1 style={{ fontSize: "1.8rem", marginBottom: "12px" }}>
          ðŸ§ª Toxicity Predictor (GNN)
        </h1>

        {/* SMILES Input */}
        <label style={{ fontWeight: "600" }}>Enter SMILES:</label>
        <input
          value={smiles}
          onChange={(e) => setSmiles(e.target.value)}
          placeholder="Example: CCO"
          style={{
            width: "100%",
            padding: "12px",
            marginTop: "8px",
            marginBottom: "20px",
            borderRadius: "10px",
            border: "1px solid #ddd",
          }}
        />

        {/* 2D Molecule Viewer */}
        {smiles && <MoleculeViewer smiles={smiles} />}

        {/* Predict Button */}
        <button
          onClick={handlePredict}
          disabled={loading}
          style={{
            width: "100%",
            padding: "12px",
            background: loading ? "#888" : "#4f46e5",
            border: "none",
            color: "white",
            fontSize: "1rem",
            borderRadius: "10px",
            marginBottom: "20px",
          }}
        >
          {loading ? "Predictingâ€¦" : "ðŸš€ Predict Toxicity"}
        </button>

        {/* Toxic Fragment Detection */}
        {smiles && <ToxicFragmentHighlight smiles={smiles} />}

        {/* Results Table */}
        {result && !result.error && (
          <div style={{ marginTop: "30px" }}>
            <h2>Results</h2>

            <table style={{ width: "100%", borderCollapse: "collapse" }}>
              <thead>
                <tr>
                  <th style={thStyle}>Endpoint</th>
                  <th style={thStyle}>Meaning</th>
                  <th style={thStyle}>Risk</th>
                </tr>
              </thead>

              <tbody>
                {Object.entries(result.predictions).map(([endpoint, obj]) => (
                  <tr key={endpoint}>
                    <td style={tdStyle}>{endpoint}</td>
                    <td style={tdStyle}>
                      <i>{endpointMeaning[endpoint]}</i>
                    </td>
                    <td style={tdStyle}>
                      <span
                        style={{
                          padding: "6px 12px",
                          borderRadius: "8px",
                          color: "white",
                          background:
                            obj.risk_level === "Toxic"
                              ? "#d9534f"
                              : obj.risk_level === "Medium Risk"
                              ? "#f0ad4e"
                              : "#5cb85c",
                        }}
                      >
                        {obj.risk_level}
                      </span>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
}
